package com.hq.bean;public class Video implements java.io.Serializable {	private int id;	private int house_id;	private String dis;	private String path;	private String mime;	private String orgname;	private String links;	private int channel_id;	private int level;	private String code;	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public int getHouse_id() {		return house_id;	}	public void setHouse_id(int house_id) {		this.house_id = house_id;	}	public String getDis() {		return dis;	}	public void setDis(String dis) {		this.dis = dis;	}	public String getPath() {		return path;	}	public void setPath(String path) {		this.path = path;	}	public String getMime() {		return mime;	}	public void setMime(String mime) {		this.mime = mime;	}	public String getOrgname() {		return orgname;	}	public void setOrgname(String orgname) {		this.orgname = orgname;	}	public String getLinks() {		return links;	}	public void setLinks(String links) {		this.links = links;	}	public int getChannel_id() {		return channel_id;	}	public void setChannel_id(int channel_id) {		this.channel_id = channel_id;	}	public int getLevel() {		return level;	}	public void setLevel(int level) {		this.level = level;	}	public String getCode() {		return code;	}	public void setCode(String code) {		this.code = code;	}}